import NavigationMenu from "./NavigationMenu";
import MyLogo from "../../Media/instagram-logo1.png";

const Header = () => {
    return (
        <>
            <header className="main-header">

                <nav className="nav-section">
                    <NavigationMenu />
                </nav>
            </header>
        </>
    );
};

export default Header;
